import React, { Component } from "react";
import PersonStyle from"./Person.module.css";
class Person extends Component {
  constructor(props) {
    super(props);
    this.props = props;
    this.state = {
      person: [
        {
          name: "Anas", age:10
        },
        {
          name: "John", age:20
        },
        {
          name: "Essac", age:30
        }
      ]
    };
  
  render() ;{
    return (
      <div>
        <h1>
        My name is {this.state.person[0].name} and My age is {this.state.person[0].age}
        </h1>
      </div>
    )
  }
}
};

export default Person;
